		topic={'Design osaaminen'}
		body={'Yrityksesi verkkosivut toimivat k채yntikorttina ja suorana kosketuspintana asiakkaisiisi. Me varmistamme designerimme toimesta ett채 sivujesi design on toiveittesi mukainen.'}
	/>
    </div>
    <Footer />
    </div>


  );

}




export default Home;
